$('.rating-form').rating({
  extendSymbol: function () {
    var user_id = $(this).attr('data-user-id');
    var stars = $('input').rating('rate');

    $.ajax({
      type: 'post',
      url: '/users/' + user_id + '/rate',
      data: {rating: stars}
    }); 
  }
})
